def db_create(event):
    try:
        banco_dividendos = sqlite3.connect("fornecedores.db")
        banco = banco_dividendos.cursor()
        banco.execute('''
        CREATE TABLE fornecedores (
            ID INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
            NOME varchar not null,
            APELIDO varchar,
            TELEFONE tinyint not null,
            CPF text,
            BANCO text,
            AGENCIA text,
            CP char(1) CHECK (CP IN ('P','C','-')),
            ENDERECO text,
            FOREIGN KEY (CP) REFERENCES somatoria_diaria (CP))''')
        banco_dividendos.commit()
        banco.execute('''
        CREATE TABLE somatoria_diaria (
            ID INTEGER,
            DATA DATE,
            DIVIDA NUMBER DEFAULT 0,
            SITUACAO CHAR(1) DEFAULT N,
            VALOR_LT_UND FLOAT,
            QUANT_LTS INTEGER,
            VALOR_LTS_TOTAL FLOAT,
            PAGAMENTO CHAR(1),
            DESCONTO_RS FLOAT,
            MOTIVO TEXT,
            VER_PAG char(1) CHECK (VER_PAG IN ('S','N')),
            CP char(1),
            FOREIGN KEY (ID) REFERENCES fornecedores(ID));  
        ''')
        banco.execute('''CREATE TABLE PRECO_PADRAO_PG(
            PRECO NUMBER,
            TRANFERENCIA NUMBER,
            CHEQUE NUMBER
        )''')
        banco_dividendos.commit()
        banco_dividendos.close()
        WIN_INFO()
    except:
        WIN_INFO_ERRO()

